/**
 * index.js
 */
import React from 'react';
import { render } from 'react-dom';

import './styles.css';

const socket = openSocket('http://localhost:8000');

class MainApp extends React.Component {
  constructor(props) {
    super(props);
  }

  componentDidMount() {
    const socket = io();

    window.onSpotifyWebPlaybackSDKReady = () => {
      let { access_token } = window;
      let { interval } = window;

      const player = new Spotify.Player({
        name: 'Music Sessions',
        getOAuthToken: (cb) => {
          cb(access_token);
        },
      });
      // Sets the token and periodically refreshs token

      const intervalFunction = () => {
        console.log('refreshing token');
        fetch('/login/refresh')
          .then(res => res.json())
          .then((data) => {
            console.log(data);
            access_token = data.access_token;
            interval = data.interval;
            player.getOAuthToken(access_token);
            setTimeout(internalFunction, interval);
          })
          .catch(err => console.log(err));
      };
      if (interval < 0) {
        interval = 0;
      }
      setTimeout(intervalFunction, interval);
      // Error handling
      player.addListener('initialization_error', ({ message }) => {
        console.error(message);
      });
      player.addListener('authentication_error', ({ message }) => {
        console.error(message);
      });
      player.addListener('account_error', ({ message }) => {
        console.error(message);
      });
      player.addListener('playback_error', ({ message }) => {
        console.error(message);
      });
      // Playback status updates
      player.addListener('player_state_changed', (state) => {});
      // Ready
      player.addListener('ready', ({ device_id }) => {
        console.log('Ready with Device ID', device_id);
      });

      // recieve playback change
      socket.on('player_state_changed', (state) => {
        console.log(state);
      });
      // Not Ready
      player.addListener('not_ready', ({ device_id }) => {
        console.log('Device ID has gone offline', device_id);
      });
      // Connect to the player!
      player.connect();
    };
  }

  render() {
    return (
      <div className="MainApp">
        <button>Host</button>
        <button>Join</button>
      </div>
    );
  }
}

// render the app
render(<MainApp />, document.getElementById('app'));
